export const sendSlotInfoToStore = (slotInfo) => ({
  type: "SEND_SLOT_INFO",
  payload: slotInfo,
})
export const removeSlotInfoFromStore = (slotName) => ({
  type: "REMOVE_SLOT_INFO",
  payload: slotName,
})
